import { useSelector } from "react-redux"


export const onClick = (value, searchdata) => {
    return (dispatch) => {
        const ValueStore = []
        for (let i in searchdata) {
            for (let n in searchdata[i]) {
                // for (let b = 1; b >= searchdata.length; b++) {
                if (value === searchdata[i][n].name) {
                    ValueStore.push(searchdata[i][n])
                    console.log(ValueStore)
                }
            }
        }
        dispatch({
            type: 'onclick',
            payload: ValueStore
        })
    }
}

export const SearchFilter = (event, searchdata) => {
    return (dispatch) => {
        onClick(event)
        dispatch({
            type: 'searchfilter',
            payload: ValueStore
        })
    }
}
